In addition to files for John Cowper Powys (49 folders) and Phyllis Playter (99 folders), correspondence is most extensive for Gamel Woolsey (84 folders), Claude Colleer Abbott (94 folders; includes poems), and Valentine Ackland (24 folders; includes poems). Other major literary correspondents are: Redwood Anderson (most outgoing; incoming includes a poem), Gerald Brenan (includes poems), Gladys Brooks, Vere H. Collins, Giovanni Costigan, C. G. L. Du Cann, Eve Elwin, Derrick Leon (concerning Marcel Proust), Marianne Moore, Marie Nordlinger and her daughter Pauline Green (concerning Reynaldo Hahn and Marcel Proust), Alan Osbourne (concerning Robert Louis Stevenson), Sylvia Townsend Warner, James Sibley Watson, Jr., Louis Wilkinson (most outgoing) and Joan Lambert Wilkinson (most outgoing). Correspondence with other friends includes extensive files for Dorothy Blodgett, Madeleine Walker Curry, John Fisher, Derek Lindsay, Henriette Metcalf ("Fifirella" in 
               The Day is Gone
            ), Peggy Newman, Rosamond Rose, Florida Scott-Maxwell (most outgoing), Oliver Stoner (most outgoing), and Giles Wordsworth.
